(240,1712910445,1,'BE',1,0,18,'pages','{\"doktype\":\"1\",\"slug\":\"\\/donate\",\"hidden\":1,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"categories\":\"0\",\"l10n_diffsource\":\"\",\"layout\":\"0\",\"lastUpdated\":0,\"newUntil\":0,\"cache_timeout\":\"0\",\"shortcut\":0,\"shortcut_mode\":\"0\",\"content_from_pid\":0,\"mount_pid\":0,\"module\":\"\",\"sitemap_priority\":\"0.5\",\"twitter_card\":\"summary\",\"pid\":1,\"sorting\":360,\"perms_userid\":1,\"perms_groupid\":0,\"perms_user\":31,\"perms_group\":27,\"perms_everybody\":0,\"title\":\"Donate\",\"sys_language_uid\":0,\"crdate\":1712910445,\"t3ver_stage\":0,\"tstamp\":1712910445,\"uid\":18}',0,'0400$360080e28f9989333a23972bbf7d755b:9e9e8c5ba4be654320a3cd25d73d01a4'),
(241,1712910491,1,'BE',1,0,27,'tt_content','{\"CType\":\"text\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"categories\":\"0\",\"l18n_parent\":0,\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"bullets_type\":\"0\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"0\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"cols\":\"0\",\"recursive\":\"0\",\"list_type\":\"\",\"target\":\"\",\"sectionIndex\":\"1\",\"accessibility_title\":\"\",\"accessibility_bypass_text\":\"\",\"l18n_diffsource\":\"\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":18,\"sorting\":256,\"header\":\"Donate & Support my Work\",\"header_link\":\"\",\"subheader\":\"If you are using any mof my extensions, please think about a small donation!\",\"bodytext\":\"<h3>Why should you donate to me?<\\/h3>\\r\\n<p>All I develop is licensed as open-source. This is certainly great for everyone. However I do most of it in my complete sparetime.<\\/p>\\r\\n<h3>Where will my money go?<\\/h3>\\r\\n<p>Your donation is used to make me a happy life. I will buy me some new books, tickets to TYPO3 events, chocolate and nice things for my girlfriend ;)<\\/p>\\r\\n<h3>How much should I donate?<\\/h3>\\r\\n<p>It is really up to you! My primary reason to code and to publish is to enable you to do awesome stuff with it.<\\/p>\\r\\n<p>Nevertheless, maybe a small calculation helps: If you develop a website for a client and you include e.g. my awesome news extension for \\u20ac 500, you could donate 10%.<\\/p>\\r\\n<h3>What if I don\\u2019t have any money left?<\\/h3>\\r\\n<p>Write me a mail or a postcard and say thanks, this would be already amazing!<\\/p>\",\"linkToTop\":\"0\",\"hidden\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1712910491,\"t3ver_stage\":0,\"tstamp\":1712910491,\"uid\":27}',0,'0400$69e4cfb3c982c46ac0349c5944e03497:9c3671c42eb2c0522de6952ddc52c9a7'),
(242,1712910568,1,'BE',1,0,28,'tt_content','{\"CType\":\"text\",\"starttime\":0,\"endtime\":0,\"sys_language_uid\":0,\"categories\":\"0\",\"l18n_parent\":0,\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"bullets_type\":\"0\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"0\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"0\",\"imagecols\":\"2\",\"cols\":\"0\",\"recursive\":\"0\",\"list_type\":\"\",\"target\":\"\",\"sectionIndex\":\"1\",\"accessibility_title\":\"\",\"accessibility_bypass_text\":\"\",\"l18n_diffsource\":\"\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"uploads_description\":0,\"uploads_type\":\"0\",\"pid\":18,\"sorting\":512,\"header\":\"How to donate\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>There are many ways you can donate, it is just a matter of choice:<\\/p>\\r\\n<ul><li>Buy something nice from my <a href=\\\"https:\\/\\/www.amazon.de\\/registry\\/wishlist\\/8F573K08TSDG\\\">amazon.com wishlist<\\/a><\\/li><li>Send me a bottle of wine or some chocolate. You can find my address here.<\\/li><li>Buy me a drink at a TYPO3 event<\\/li><li>use Paypal (or bank transfer which is what I prefer)<\\/li><\\/ul>\",\"linkToTop\":\"0\",\"hidden\":\"0\",\"fe_group\":\"\",\"editlock\":\"0\",\"rowDescription\":\"\",\"crdate\":1712910568,\"t3ver_stage\":0,\"tstamp\":1712910568,\"uid\":28}',0,'0400$163249880bda7cde9b67453e022b6ce8:b5d015227f2b36f7786e2ff963ca9d51'),
